import NavBars from './components/NavBars';


const Index = () => (
    
<div className="wrapper">

<NavBars />


  <img src="http://drive.google.com/uc?export=view&id=1XZhPmy4AWCI5k8O0oOdFSU266HD_AsEY"/>



<style jsx>{`
        p{   
          font-family: 'Barlow', sans-serif;
          
        }
        div{
            text-align: center;
        }
        img{
            height: 520px;
            position: absolute;
            top: 17%;
            left: 26%;
        }

        @media only screen and (max-width:500px){
          img{
            height: 350px;
            position: absolute;
            top: 25%;
            left: 5%;
          }
        }

  
        

       
      `}</style>
</div>

  );
  
  export default Index;
